// Model step function
void RL_AGENT_SAFE_POLICY::step(float g_relativeDistance, ros::Publisher& publisher, float velocity, ros::Duration elapsedTime)
{
  c_coder_internal_ctarget_dlne_T *net;
  dlarray_1_RL_AGENT_SAFE_POLIC_T dlArrayOutputs_idx_0;
  real32_T tmp[4];
  


  // Define Rosbag signals that you want to read out
  std_msgs::Float64 relativeDistanceMsg;
  std_msgs::Float64 safeDistanceMsg;
  std_msgs::Float64 relativeVelocityMsg;
  std_msgs::Float64 velocityMsg;
  std_msgs::Float64 accelerationMsg;
  std_msgs::Float64 msg;


  // MATLAB Function: '<S1>/PolicyWrapper'
  if (!RL_AGENT_SAFE_POLICY_DW.policy_not_empty) {
    RL_AGENT_SAFE_POLICY_DW.gobj_1.IsNetworkInitialized = false;
    RL_AGENT_SAFE_POLICY_DW.gobj_1.matlabCodegenIsDeleted = false;
    RL_AGENT_SAFE_POLICY_DW.gobj_2.InternalNetwork_ =
      &RL_AGENT_SAFE_POLICY_DW.gobj_1;
    RL_AGENT_SAFE_POLICY_DW.gobj_2.matlabCodegenIsDeleted = false;
    RL_AGENT_SAFE_POLICY_DW.gobj_2.isInitialized = 1;
    RL_AGENT_SAFE_POLICY_DW.gobj_2.isSetupComplete = true;
    RL_AGENT_SAFE_POLICY_DW.policy.ActionBounder_.UpperLimits_ = 2.0;
    RL_AGENT_SAFE_POLICY_DW.policy.ActionBounder_.LowerLimits_ = -3.0;
    RL_AGENT_SAFE_POLICY_DW.policy.Model_ = &RL_AGENT_SAFE_POLICY_DW.gobj_2;
    RL_AGENT_SAFE_POLICY_DW.policy.matlabCodegenIsDeleted = false;
    RL_AGENT_SAFE_POLICY_DW.policy.isInitialized = 1;
    RL_AGENT_SAFE_POLICY_DW.policy.isSetupComplete = true;
    RL_AGENT_SAFE_POLICY_DW.policy_not_empty = true;
  }

  net = RL_AGENT_SAFE_POLICY_DW.policy.Model_->InternalNetwork_;

  // SignalConversion generated from: '<S2>/ SFunction ' incorporates:
  //   Inport: '<Root>/rc_car_velocity'
  //   Inport: '<Root>/relative velocity'
  //   Inport: '<Root>/relative_distance'
  //   Inport: '<Root>/safe_distance'
  //   MATLAB Function: '<S1>/PolicyWrapper'
  


  ROS_INFO("Relative Distance: [%f]", g_relativeDistance); // in m
  relativeDistanceMsg.data = g_relativeDistance; 
  velocityMsg.data = velocity;
  if(elapsedTime.toSec() == 0.0){
  float previousDistance = g_relativeDistance;
  }
  
  int currentSecond = elapsedTime.toSec();
  ROS_INFO("Timediff: [%f]", elapsedTime.toSec()); 
  
  if(currentSecond > lastSecond){
    lastSecond = currentSecond;
    newDistance = g_relativeDistance;
    float distanceDifference = newDistance - previousDistance;
    if(distanceDifference !=0.0)
     { 
     relative_velocity = (distanceDifference/1) - velocity;
     previous_velocity = relative_velocity;
     }
    else
     {
     relative_velocity = previous_velocity;
     }
    }
  else
  {
  relative_velocity = previous_velocity;
  }
 




 relativeVelocityMsg.data = relative_velocity;
 // else{
 // relative_velocity = previous_velocity;
 // }
 // previous_velocity = relative_velocity;
  float time_gap = 0.1;
  float safe_distance = 0.1 + (0.5*velocity);
  safeDistanceMsg.data = safe_distance;
  ROS_INFO("Velocity: [%f]", velocity); // in m/s
  ROS_INFO("Relative Velocity: [%f]", relative_velocity); // in m/s
  ROS_INFO("Safe Distance: [%f]", safe_distance); // in m
  ros::Time timestamp = ros::Time::now();




  tmp[0] = static_cast<real32_T>(g_relativeDistance);
  tmp[1] = static_cast<real32_T>(safe_distance);
  tmp[2] = static_cast<real32_T>(relative_velocity);
  tmp[3] = static_cast<real32_T>(velocity);

  // MATLAB Function: '<S1>/PolicyWrapper'
  dlArrayOutputs_idx_0 = RL_AGENT_SAFE_dlnetwork_predict(net, tmp);
  printf("Action: %f\n", static_cast<double>(dlArrayOutputs_idx_0.Data));
  // Outport: '<Root>/acceleration' incorporates:
  //   MATLAB Function: '<S1>/PolicyWrapper'

  double actionValue = static_cast<double>(std::fmax(std::fmin(static_cast<real_T>
    (dlArrayOutputs_idx_0.Data),
    RL_AGENT_SAFE_POLICY_DW.policy.ActionBounder_.UpperLimits_),
    RL_AGENT_SAFE_POLICY_DW.policy.ActionBounder_.LowerLimits_));
    accelerationMsg.data = actionValue;
  

    // Check if the acceleration falls within the dead zone ranges
    if (actionValue >= dead_zone_min && actionValue <= dead_zone_max) {
       mappedValue= 0.0; // Return 0 RPM for the dead zone
   }
   else if (actionValue > dead_zone_max) {
    // Map positive acceleration values to the RPM range from 1001 to 4000
    mappedValue = ((actionValue - 0) / (2 - 0)) * (7400 - 1300) + 1300;


   }
   else {
  //   Map negative acceleration values to the RPM range from -2000 to -1001
  mappedValue = ((actionValue - (-3)) / (0 - (-3))) * (-1000 - (-2000)) + (-2000);
  }    
    ros::Time now = ros::Time::now();
    msg.data = mappedValue;
    printf("Action: %f\n", msg.data);
    publisher.publish(msg);
    bag.write("/relative_distance_topic", now, relativeDistanceMsg);
    bag.write("/safe_distance_topic", now,safeDistanceMsg );
    bag.write("/velocity_topic", now,velocityMsg );
    bag.write("/relative_velocity_topic", now, relativeVelocityMsg);
    bag.write("/Acceleration_rpm", now, msg);
    bag.write("/Acceleration", now, accelerationMsg);

}




